import './Navbar.css';
import logout from '../../assets/logout.png';

const Navbar = () => {
  const user = localStorage.getItem('username');


    function reloadPage() {
        window.location.reload();
    }

    return (
        <div className='nav'>
            <div className="nav-logo" onClick={reloadPage}>G | K </div>
            <div className='list'>Document Management</div>
            <div className='logins'>
              <div>{localStorage.getItem(username)}</div>
            <div><img src={logout} alt="Logout" /></div>
          </div>
        </div>
    );
}

export default Navbar;
